USFoods.Utils = {
    browserDetection: function () {
        //Check if browser is IE
        if (navigator.userAgent.search("MSIE") > -1) {
            // insert conditional IE code here
            $('html').addClass('user-msie');
        }
        //Check if browser is Chrome
        else if (navigator.userAgent.search("Chrome") > -1) {
            $('html').addClass('user-chrome');
        }
        //Check if browser is Firefox
        else if (navigator.userAgent.search("Firefox") > -1) {
            $('html').addClass('user-firefox');
        }
        //Check if browser is Safari
        else if (navigator.userAgent.search("Safari") > -1) {
            $('html').addClass('user-safari');
        }
        //Check if browser is Opera
        else if (navigator.userAgent.search("Opera") > -1) {
            $('html').addClass('user-opera');
        }
    },
    Android: function () {
        return /Android/i.test(navigator.userAgent);
    },
    iOS: function () {
        return /iPhone|iPad|iPod/i.test(navigator.userAgent);
    },
    iOSVersion: function () {
        var match = (navigator.appVersion).match(/OS (\d+)_(\d+)_?(\d+)?/);
        var version = parseInt(match[1], 10);
        return version;
    },
    isMobileDevice: function () {
        return (this.Android() || this.iOS());
    },
    getUrlParamsToObject: function (isHash) {
        // This method is for gathering url parameters or hash values
        // Returning them as an object for use.
        var query_string = {};
        var query = "";
        if (isHash === true) {
            query = window.location.hash.substring(1);
        } else {
            query = window.location.search.substring(1);
        }
        if (query.length === 0) return {};
        var vars = query.split("&");
        for (var i = 0; i < vars.length; i++) {
            var pair = vars[i].split("=");
            var pairFirst = decodeURIComponent(pair[0]);
            var pairSecond = decodeURIComponent(pair[1]);
            // If first entry with this name
            if (typeof query_string[pairFirst] === "undefined") {
                query_string[pairFirst] = pairSecond;
                // If second entry with this name
            } else if (typeof query_string[pairFirst] === "string") {
                var arr = [query_string[pairFirst], pairSecond];
                query_string[pairFirst] = arr;
                // If third or later entry with this name
            } else {
                query_string[pairFirst].push(pairSecond);
            }
        }
        return query_string;
    },
    useGeolocation: function () {

        if (USFoods.Utils.isAuthorAndNotLocal()) {
            return;
        }

        var geo_options = {
            enableHighAccuracy: true
        };

        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(
                function (pos) {
                    if (window.google !== undefined) {
                        var geocoder = new google.maps.Geocoder();
                        var geocode_params = {
                            "location": {
                                lat: pos.coords.latitude,
                                lng: pos.coords.longitude
                            }
                        };

                        // Send location to Geocoder for zip
                        geocoder.geocode(geocode_params, function (results, status) {
                            if (status === 'OK') {
                                let place = results[0].formatted_address.split(", ");
                                place[2] = place[2].split(" ");
                                USFoods.vueEvents.$emit("geoLocate", {
                                    "zip": place[2][1],
                                    "lat": results[0].geometry.location.lat(),
                                    "long": results[0].geometry.location.lng()
                                });
                            } else {
                                USFoods.vueEvents.$emit("geoLocate");
                                Vue.config.devtools && console.error("Geocode was not successful for the following reason: " + status);
                            }
                        });
                    } else {
                        USFoods.vueEvents.$emit("geoLocate");
                        Vue.config.devtools && console.error("Google is undefined, using fallback");
                    }
                },
                function (error) {
                    // No search parameter data emitted
                    USFoods.vueEvents.$emit("geoLocate");
                    /* eslint-disable indent */
                    switch(error.code) {
                        case error.PERMISSION_DENIED:
                            USFoods.vueEvents.$emit("geolocationDenied");
                            console.error('User denied the request for Geolocation.');
                            break;
                        case error.POSITION_UNAVAILABLE:
                            console.error('Location information is unavailable.');
                            break;
                        case error.TIMEOUT:
                            console.error('The request to get user location timed out.');
                            break;
                        case error.UNKNOWN_ERROR:
                            console.error('An unknown error occurred.');
                            break;
                    }
                    /* eslint-enable indent */
                },
                geo_options);
        } else {
            // no navigator present, No search parameter data emitted
            USFoods.vueEvents.$emit("geoLocate");
        }
    },
    getGCLID() {
        let id = null;
        const urlParameter = USFoods.Utils.getUrlParameter("gclid", true);
        if (urlParameter) {
            id = urlParameter;
        } else {
            const cookie = USFoods.Utils.getGoogleCampaignCookie();
            if (cookie) {
                let cookieParts = cookie.split('.');
                id = cookieParts[cookieParts.length - 1];
            }
        }
        if (!id) {
            id = null;
        }
        return id;
    },
    setFormDataCookie: function(formElement) {
        let formData = new FormData(formElement);
        let json = {};
        for(let pair of formData.entries()) {
            json[pair[0]] = pair[1];
        }
        Vue.cookies.set(USFoods.vars.formDataCookieName, JSON.stringify(json), "0", '/');
    },
    getFormDataCookie: function() {
        let cookie = Vue.cookies.get(USFoods.vars.formDataCookieName);
        return cookie ? JSON.parse(cookie) : {};
    },
    removeFormDataCookie: function () {
        Vue.cookies.remove(USFoods.vars.formDataCookieName, '/');
    },
    getGoogleCampaignCookie: function() {
        return Vue.cookies.get('_gcl_aw');
    },
    getGoogleAnalyticsCookie: function () {
        return Vue.cookies.get('_gid');
    },
    getBacRegistrationCookie: function () {
        return Vue.cookies.get('usfoods_registration_info');
    },
    getBacCampaignCookie: function () {
        return Vue.cookies.get('bac_campaign');
    },
    removeBacRegistrationCookie: function () {
        Vue.cookies.remove('usfoods_registration_info', '/');
    },
    setBacRegistrationCookie: function (jsonStr, time) {
        time = (time == '') ? '3650d' : time + "d";
        Vue.cookies.set('usfoods_registration_info',
            jsonStr, time, '/');
    },
    setBacCampaignCookie: function (jsonStr, time) {
        time = (time == '') ? '90d' : time + "d";
        Vue.cookies.set('bac_campaign', jsonStr, time, '/');
    },
    getDistributionCenterCookie: function () {
        return Vue.cookies.get('usfoods_local_distribution_center');
    },
    setDistributionCenterCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_local_distribution_center',
            jsonStr, "0", '/');
    },
    getEcomUserInfoCookie: function () {
        return Vue.cookies.get('DCE_KMLI');
    },
    getEcomCustomerProfileCookie: function () {
        return Vue.cookies.get('DCE_CUST_KMLI');
    },
    removeEcomUserData: function () {
        // This is to determine what shared cookie to remove on DCE side (usfood.com vs usfoods.com);
        var loc = location.hostname.split('.');
        var domain = location.hostname;
        if (loc.length > 2) {
            domain = loc[loc.length - 2] + '.' + loc[loc.length - 1];
        }
        /* Cannot remove httpOnly DCE_KMLI cookie from client-side */
        Vue.cookies.remove("DCE_CUST_KMLI", "/", domain);
        sessionStorage.removeItem("userProfile");
        sessionStorage.removeItem("customerAccountData");
        location.reload();
    },
    setCustomerMarketingProfileCookie: function (jsonStr) {
        // This is to determine what shared cookie to set on DCE side (usfood.com vs usfoods.com);
        var loc = location.hostname.split('.');
        var domain = location.hostname;
        if (loc.length > 2) {
            domain = loc[loc.length - 2] + '.' + loc[loc.length - 1];
        }
        Vue.cookies.set('DCE_CUST_KMLI', jsonStr, "10y", '/', domain);
    },
    getFavoritesCookie: function () {
        return Vue.cookies.get('usfoods_favorited_items');
    },
    setFavoritesCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_favorited_items',
            jsonStr, '3650D', '/');
    },
    getDistributionCenterSupportCookie: function () {
        return Vue.cookies.get('usfoods_local_distribution_center_support');
    },
    setDistributionCenterSupportCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_local_distribution_center_support', jsonStr, "7D", '/');
        if (jsonStr) {
            let json = JSON.parse(jsonStr);
            if (json && json.postalCode) {
                USFoods.Utils.queryNearestChefStoreCookie(undefined, undefined, json.postalCode);
                USFoods.vueEvents.$emit("distributionCenterSupportCookieUpdate", json.postalCode);
            }
        }
    },
    getMarketInfoCookie: function () {
        return Vue.cookies.get('usfoods_local_market_info');
    },
    setMarketInfoCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_local_market_info',
            jsonStr, "0", '/');
    },
    getChefStoreFormCookie: function () {
        return Vue.cookies.get(USFoods.vars.formChefStoreCookieName);
    },
    getChefStoreCookie: function () {
        return Vue.cookies.get('usfoods_chef_store');
    },
    setChefStoreCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_chef_store', jsonStr, "0", '/');

        if (!USFoods || !USFoods.vueEvents) {
            return;
        }
        USFoods.vueEvents.$emit("setChefStoreCookie");

        var event = new CustomEvent("chefStoreCookieSet");
        document.dispatchEvent(event);
    },
    getReferrerCookie: function () {
        return Vue.cookies.get('usfoods_referer');
    },
    setReferrerCookie: function () {
        Vue.cookies.set('usfoods_referer', document.referrer, "0", '/');
    },
    removeReferrerCookie: function () {
        Vue.cookies.remove('usfoods_referer', '/');
    },
    getUserRoleCookie: function () {
        return Vue.cookies.get('usfoods_user_role');
    },
    setUserRoleCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_user_role',
            jsonStr, '3650D', '/');
    },
    getUserZipCookie: function () {
        return Vue.cookies.get('usfoods_user_zip');
    },
    setUserZipCookie: function (jsonStr) {
        Vue.cookies.set('usfoods_user_zip',
            jsonStr, '3650D', '/');
    },
    viewportIsDesktop: function () {
        return ($(window).width() >= USFoods.vars.smallDesktopMin);
    },
    viewportIsMobile: function () {
        return ($(window).width() < USFoods.vars.tabletMin);
    },
    viewportIsTablet: function () {
        return ($(window).width() <= USFoods.vars.tabletMax && $(window).width() > USFoods.vars.mobileMax);
    },
    /**
     * Method to determine if string exists within another string
     */
    containsString: function (container, value) {
        if (!container || !value) {
            return false;
        }
        var returnValue = false;
        var position = container.indexOf(value);
        if (position >= 0) {
            returnValue = true;
        }
        return returnValue;
    },
    /**
     * Method to get a specific query parameter value (by name) out of window.location.search
     * @param name
     * @returns {string} Value for specified query parameter
     */
    getUrlParameter: function (name, ignoreCase) {
        name = name.replace(/[\[]/, '\\[').replace(/[\]]/, '\\]');
        name = '[\\?&]' + name + '=([^&#]*)';
        const regex = ignoreCase ? new RegExp(name, 'i') : new RegExp(name);
        const results = regex.exec(window.location.search);
        return results === null ? '' : decodeURIComponent(results[1].replace(/\+/g, ' '));
    },
    /**
     * Method that will return an updated URL with specified query parameer either added or updated (if already existed)
     * @param url
     * @param param
     * @param paramVal
     * @returns {string}
     */
    updateURLParameter: function (url, param, paramVal) {
        var newAdditionalURL = "";
        var tempArray = url.split("?");
        var baseURL = tempArray[0];
        var additionalURL = tempArray[1];
        var temp = "";
        if (additionalURL) {
            tempArray = additionalURL.split("&");
            for (var i = 0; i < tempArray.length; i++) {
                if (tempArray[i].split('=')[0] != param) {
                    newAdditionalURL += temp + tempArray[i];
                    temp = "&";
                }
            }
        }

        var rows_txt = temp + "" + param + "=" + paramVal;
        return baseURL + "?" + newAdditionalURL + rows_txt;
    },
    /**
     * Method to initialize window data Layer
     */
    sendGTMAnalytics: function (data) {
        var dataLayer = window.dataLayer || [];
        dataLayer.push(data);
    },
    queryNearestChefStoreCookie: function (lat, long, zipCode, customCookieName) {
        if (!lat && !long && !zipCode) {
            return;
        }
        $.ajax({
            url: "/bin/usfoods/location-query?data=" + encodeURIComponent(JSON.stringify({
                locationTypes: "us-foods:location-types/chef-store",
                latitude: lat,
                longitude: long,
                zip: zipCode,
                distance: USFoods.vars.chefStoreDistance
            })),
            type: "GET",
            contentType: "application/json",
            dataType: "json"
        }).done(function (data) {
            if (data.message && data.message.length > 0) {
                if (!customCookieName) {
                    USFoods.Utils.setChefStoreCookie(JSON.stringify(data.message[0]));
                } else {
                    Vue.cookies.set(customCookieName, JSON.stringify(data.message[0]), "0", '/');
                }
            } else {
                if (!customCookieName) {
                    USFoods.Utils.setChefStoreCookie(JSON.stringify({}));
                } else {
                    Vue.cookies.set(customCookieName, JSON.stringify({}), "0", '/');
                }
            }
        });
    },
    updateBacCampaignCookie: function() {
        let bacCampaignCookieData = {
            utmSource: USFoods.Utils.getUrlParameter("utm_source"),
            utmMedium: USFoods.Utils.getUrlParameter("utm_medium"),
            utmCampaign: USFoods.Utils.getUrlParameter("utm_campaign"),
            utmTerm: USFoods.Utils.getUrlParameter("utm_term"),
            utmContent: USFoods.Utils.getUrlParameter("utm_content")
        };

        USFoods.Utils.setBacCampaignCookie(JSON.stringify(bacCampaignCookieData), "2");
    },
    isLocationEnabled: function() {

        if (!navigator.geolocation || USFoods.Utils.isAuthorAndNotLocal()) {
            return false;
        }
        let canGetPosition = false;
        navigator.geolocation.getCurrentPosition(function() {
            canGetPosition = true;
        }, function() {
            canGetPosition = false;
        });
        return canGetPosition;
    },
    getRunModes: function() {
        let runModesElement = document.querySelector('meta[name="runModes"]');
        if (runModesElement) {
            return runModesElement.content.split(',');
        }
        return [];
    },
    isLocal: function() {
        return USFoods.Utils.getRunModes().includes('local');
    },
    isAuthor: function() {
        return USFoods.Utils.getRunModes().includes('author');
    },
    isAuthorAndNotLocal() {
        return !USFoods.Utils.isLocal() && USFoods.Utils.isAuthor();
    },
    updateChefStoreCookie: function () {

        if (USFoods.Utils.isAuthorAndNotLocal()) {
            return;
        }

        let supportCookie = USFoods.Utils.getDistributionCenterSupportCookie();
        let zip = supportCookie ? JSON.parse(supportCookie).postalCode : '';

        if (zip) {
            USFoods.Utils.queryNearestChefStoreCookie(undefined, undefined, zip);
        } else {

            if (!navigator.geolocation || window.google === undefined) {
                console.error('Failed to load geolocation.');
                return;
            }

            navigator.geolocation.getCurrentPosition(
                function (pos) {
                    USFoods.Utils.queryNearestChefStoreCookie(pos.coords.latitude, pos.coords.longitude);
                }, function (error) {
                    /* eslint-disable indent */
                    switch(error.code) {
                        case error.PERMISSION_DENIED:
                            console.error('User denied the request for Geolocation.');
                            break;
                        case error.POSITION_UNAVAILABLE:
                            console.error('Location information is unavailable.');
                            break;
                        case error.TIMEOUT:
                            console.error('The request to get user location timed out.');
                            break;
                        case error.UNKNOWN_ERROR:
                            console.error('An unknown error occurred.');
                            break;
                    }
                    /* eslint-enable indent */
                }, {enableHighAccuracy: true}
            );
        }
    },
    debounce: function(func, timeout = 300) {
        let timer;
        return (...args) => {
            clearTimeout(timer);
            timer = setTimeout(() => { func.apply(this, args); }, timeout);
        };
    },
    isJsonString: function(string) {
        if (!string || string.length < 1 || (string.charAt(0) !== '{' && string.charAt(0) !== '[')) {
            return false;
        }
        try {
            JSON.parse(string);
        } catch (e) {
            return false;
        }
        return true;
    },
    createHiddenInput(fieldName, parentElement) {
        let element = document.createElement('input');
        element.setAttribute('name', fieldName);
        element.setAttribute('type', 'hidden');
        parentElement.insertBefore(element, parentElement.firstChild);
        return element;
    },
    getBreakpoint() {
        const ww = window.innerWidth;
        if(ww > USFoods.vars.smallDesktopMax) return 'desktop';
        if(ww > USFoods.vars.tabletMax) return 'smalldesktop';
        if(ww > USFoods.vars.mobileMax) return 'tablet';
        if(ww > USFoods.vars.smallMobileMax) return 'mobile';
        return 'smallmobile';
    }
};

/**
 * Method to equalize height of an element to match others on a page
 */
function equalizeHeight(container, child) {
    $(container).each(function() {
        var highestBox = 0;
        $(child, this).each(function(){
            $(this).css('height', 'auto');
            if($(this).height() > highestBox) {
                highestBox = $(this).height();
            }
        });
        $(child,this).height(highestBox);
    });
}

